import React from 'react'
import Todoitems from './Todoitems'

const Todos = (props) => {
  return (
    <div className='container'>
      <h2 className='text-center'>Todo List</h2>

      <Todoitems bonda={props.todos[0]} />
    </div>
  )
}

export default Todos
